controllerName = 'C_right hand';
end = thisComp.layer(endName);
zeroName = 'IK_zero right low arm ';
zero = thisComp.layer(zeroName);
root = thisComp.layer(rootName);
controller = thisComp.layer(controllerName);
ctrlEffect = controller.effect('IK right low arm ');
limit = effect('IK Limit')(1);
FK = ctrlEffect(4);
IKFK = ctrlEffect(3) == 0;
cw = ctrlEffect(1) == 1;
function getWorldPos(L) {
    return L.toWorld(L.anchorPoint);
}
function ik() {
    var A, B, C, E, a, b, c, x, alpha, D, delta, result, V, adj1, IK, IK;
    A = getWorldPos(root);
    B = getWorldPos(end);
    C = getWorldPos(zero);
    E = getWorldPos(controller);
    a = length(B, C);
    b = length(E, A);
    c = length(A, B);
    x = $bm_div($bm_sub($bm_sum($bm_mul(b, b), $bm_mul(c, c)), $bm_mul(a, a)), $bm_mul(2, b));
    alpha = Math.acos(clamp($bm_div(x, c), -1, 1));
    D = $bm_sub(E, A);
    delta = Math.atan2(D[1], D[0]);
    result = radiansToDegrees($bm_sub(delta, $bm_mul(cw ? 1 : -1, alpha)));
    V = $bm_sub(B, A);
    adj1 = radiansToDegrees(Math.atan2(V[1], V[0]));
    IK = $bm_sum($bm_sub(result, adj1), value);
    if (IK < limit)
        IK = $bm_sum(IK, 360);
    return IK;
}
$bm_rt = IKFK ? ik() : FK;

